import React, { useState } from 'react';

function PainelFavoritos() {
  const [favoritos, setFavoritos] = useState([]);

  const addToFavorites = (atleta) => {
    setFavoritos([...favoritos, atleta]);
  };

  return (
    <div>
      <h1>Favoritos</h1>
      <div className="resultado">
        {favoritos.map((atleta, index) => (
          <div key={index}>
            <h1>{atleta.player_name}</h1>
            <p>
              Idade: {atleta.player_age} | País: {atleta.player_country} | Posição: {atleta.player_type} | Time: {atleta.team_name}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default PainelFavoritos;
